    // layer alert
    var frontAlert = function frontAlert() {
        var $wrap = $('.br__layer-alert');
        var $title = $wrap.find('.layer-alert__title');
        var $script = $wrap.find('.layer-alert__body__script');
        var $btn = $wrap.find('.layer-alert__btn');
        var $close = $wrap.find('.layer-alert__close');

        var fn = {
            'data': {
                'title': '',
                'script': '',
                'btn': '', //  1: 확인, 2: 확인, 취소
                'callback': ''
            },
            'open': function open(title, script) {
                var btn = arguments.length > 2 && arguments[2] !== undefined ? arguments[2] : false;
                var callback = arguments[3];

                this.data.title = title;
                this.data.script = script;
                this.data.btn = btn;
                this.data.callback = callback;
                fn.setContent();
                window.bodyScroll.fix();
                $wrap.addClass('br__layer-alert--show');
                return this;
            },
            'close': function close() {
                var useCallback = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : true;
                var eventTarget = arguments.length > 1 && arguments[1] !== undefined ? arguments[1] : 'undefined';

                if (useCallback && typeof this.data.callback == 'function') {
                    if (eventTarget == 'undefined' || $(eventTarget).hasClass('layer-alert__btn--submit') || !this.data.btn) {
                        this.data.callback();
                    }
                }
                $wrap.removeClass('br__layer-alert--show');
                window.bodyScroll.release();
                // 데이터 리셋
                this.data = {
                    'title': '',
                    'script': '',
                    'btn': '', //  1: 확인, 2: 확인, 취소
                    'callback': ''
                };
                return this;
            },
            'setContent': function setContent() {
                $title.empty().html(this.data.title);
                $script.empty().html(this.data.script);
                $btn.removeClass('layer-alert__btn--show');
                if (this.data.btn) {
                    // 확인, 취소
                    $btn.addClass('layer-alert__btn--show');
                } else {
                    // 확인
                    $btn.filter('.layer-alert__btn--submit').addClass('layer-alert__btn--show');
                }

                var _self = this;
                $wrap.off('click').on('click.close', '.layer-alert__close, .layer-alert__btn', function (e) {
                    e.preventDefault();
                    _self.close(true, this);
                });
                return this;
            }
        };
        return fn;
    };
